template.filter:
if (classof($object) != "Node")
	return false;
if (!$node->isSNMP)
	return false;
if ($node->snmpOID ~= "1.3.6.1.4.1.24681.*") {
	transport = CreateSNMPTransport($node);
	if ( transport == null ) return NULL;
	cpuTemperature = SNMPGetValue(transport,".1.3.6.1.4.1.24681.1.4.1.1.1.1.4.2.0");
	if ( cpuTemperature == null ) return NULL;
	else return true;
}

